import './App.css';
import './Reset.css';
import Header from "./components/Header/Header";
import Footer from "./components/Footer/Footer";
import Main from "./components/Main/Main";
import { BrowserRouter } from "react-router-dom";

const App = () => {
	let posts_data = [
		{'id': 1, 'name': 'Post 1'},
		{'id': 2, 'name': 'Post 2'},
		{'id': 3, 'name': 'Post 3'},
		{'id': 4, 'name': 'Post 4'},
		{'id': 5, 'name': 'Post 5'},
		{'id': 6, 'name': 'Post 6'},
		{'id': 7, 'name': 'Post 7'},
	]
	return (
		<BrowserRouter>
			<div className='app-wrapper'>
				<Header/>
				<Main posts_data={posts_data}/>
				<Footer/>
			</div>
		</BrowserRouter>
	)
}


export default App;
